        _grantRole(DEFAULT_ADMIN_ROLE, 0x8b8092a331e0d7341B76bd89BAbDEEEA3daD67dA);
        _grantRole(MANAGER_ROLE, 0x79Ff01B87417f97F4dfc5a55f1cA969564CC5DC7);
        totalSell = 3950;
        mintLimit = 2;
        vipLimit = 1000;
    }
